    'label2':"<p class='app-head-text'>समतल, साफ सतह, वज़न मशीन, स्टेडियोमीटर या दीवार पर  चिपकायी गई मापने वाली टेप</p>",
    'label20':"<p class='app-head-text'>यदि संभव हो, तो टेबल की ऊंचाई प्रतिभागी की लंबाई के हिसाब से एडजस्ट करें ताकि प्रतिभागी  डिस्क के सामने आराम से खड़ा हो सके। दो पीले डिस्क को मेज पर 60 सेमी की दूरी पर रखें । आयताकार दोनों डिस्क के बीच बराबर दूरी पर रखें  । नॉन प्रेफर्ड हाथ को  आयताकार पर रखें । प्रतिभागी जितनी जल्दी हो सके अपने  प्रेफर्ड हाथ से  दोनों डिस्क के बीच के भाग को  एक के बाद एक  छूता रहे। 25 पूरे चक्र (50 टैप) दोहराने के लिए लिया गया समय प्रतिभागी का टेस्ट स्कोर होगा ।</p>",
