    'label22':"<p class='app-head-text'>जिम मैट और समतल साफ सतह</p>",
    'label23':"<p class='app-head-text'>शरीर के ऊपरी भाग की क्षमता और सहनशक्ति</p>",
    'label24':"<p class='app-head-text'><strong>बालकों के लिए: </strong> इस टेस्ट को शुरू करने से पहले प्रतिभागी शरीर को  सीधा रखते हुए अपने दोनों  हाथों और पैरों की उँगलियों को जमीन पर टिकाएगा । इस दौरान उसकी दोनों बाजू सीधी और कंधे के बराबर  चौड़ाई पर रहेंगी।  प्रतिभागी  पीठ और घुटनों को सीधा रखते हुए अपने ऊपरी शरीर को नीचे की ओर तब तक ले जाएगा जब‍ तक उसकी बाजू की कोहनियां 90 डिग्री का कोण नहीं बना लेती और  फिर अपनी आरंभिक स्थिति में वापस आ जाएगा । इस  क्रिया को दोहराते हुए टेस्ट तब तक जारी रहता है जब तक प्रतिभागी थक न जाये या अपने निर्धारित लक्ष्य को पूरा कर ले ।</p><p class='app-head-text'><strong>बालिकाओं के लिए:  </strong>मोडीफाइड पुश-अप्स को शुरु करने के लिए  प्रतिभागी  पैरों की जगह  दोनों घुटनों को जमीन पर रखेंगे ।  इसके अलावा बाकी सारी प्रकिया बालकों के समान रहती है। </p>",
    'label25':"<p class='app-head-text'>प्रतिभागी का स्कोर उसकी पहली और फाइनल दूरी का अंतर होगा</p>",
    'label26':"<p class='app-head-text'>सिट एंड रीच बॉक्स  12”X12” (साइड से ) 12” X 10“( सामने  और पीछे की ओर से ) और उपर से 12” X 21”।  बॉक्स का टॉप पेनल सेंटीमीटर/मिलिमीटर के स्केल मे दर्शाया होना चाहिए। वर्टीकल प्लेन, जिसके सामने प्रतिभागी के पैर रखे जाएँगे, 23 सेंटीमीटर के मार्क पर होना चाहिए।</p>",
    'label27':"<p class='app-head-text'>यह टेस्‍ट प्रतिभागी के लचीलेपन, विशेषकर पीठ और जांघ की  मांसपेशियों के  लचीलेपन को मापता है। यह टेस्ट इसलिए भी महत्वपूर्ण है क्योंकि इन जगहों पर   जकड़न होने से कमर का दर्द भी हो सकता है। </p>",
    'label28':"<p class='app-head-text'>इस टेस्‍ट को करने के लिए प्रतिभागी नंगे पैर अपनी टांगो को सीधा रखते हुए फर्श पर बैठ जाता है। पैरों के तलों को सिट एंड रीच बॉक्स के सामने लगा के  रखता है। इस दौरान दोनों घुटनों को दबाकर टांगों को सीधा रखें।  परीक्षक चाहे तो घुटनों को दबाकर रखने मे सहायता कर सकता है।  हथेलियों को नीचे की ओर रखते हुए हाथ के उपर हाथ रखें और प्रतिभागी  आगे झुकते हुए अपने हाथों को सिट एंड रीच बॉक्स पर रखता है। यह प्रतिभागी की पहली रीडिंग होगी। सुनिश्चित करें कि आगे की ओर झुकते समय हाथ एक साथ बने रहें। कुछ अभ्यास के बाद प्रतिभागी आगे झुकते हुए अपने हाथों को अधिकतम दूरी पर ले जाकर कुछ समय के लिए रूका रहेगा और यह दूरी प्रतिभागी की फाइनल रीडिंग होगी। प्रतिभागी का स्कोर पहली और फाइनल रीडिंग के बीच की दूरी होगी। ध्यान रखें कि प्रतिभागी आगे बढ़ते हुए झटकों का सहारा न ले ।</p>",
    'label29':"<p class='app-head-text'>50 मी० दूरी को पूरा करने में लिया गया समय</p>",
    'label3':"<p class='app-head-text'>बॉडी मास इंडेक्‍स (बीएमआई) किसी प्रतिभागी  की वर्तमान लम्‍बाई और वज़न के आधार पर उसकी शरीर की चर्बी (फैट) को मापता है। बीएमआई की  गणना,  बॉडी मास (एम) और लंबाई(एच ),  जिसमे (एम) शरीर का मास किलोग्राम मे और लंबाई (एच) मीटर मे, इस फार्मूले (मास /लंबाई x लंबाई) का उपयोग करते हुए की जाती है। उच्चतम स्कोर शरीर मे चर्बी का उच्च स्कोर दर्शाता है ।</p>",
    'label30':"<p class='app-head-text'>मापने वाली टेप, चिन्हित ट्रैक, स्टॉपवाच  , कोन मार्कर, कम से कम 60 मी0 समतल और साफ सतह।</p>",
    'label31':"<p class='app-head-text'>तेजी और गति मापता है। </p>",
    'label32':"<p class='app-head-text'>इस टेस्‍ट को करने से पहले वार्मिंग अप एवं अभ्यास करना जरूरी है । प्रतिभागी दौड़ को स्टैंडिंग अवस्‍था से शुरू करेंगे  और अपने  एक पैर को दूसरे पैर से आगे रखेंगे।  परन्‍तु आगे का पैर आरंम्भिक लाईन से पीछे होना चाहिए  । प्रतिभागियों को 50 मी० की दूरी कम से कम समय में पूरी करने के लिए तेज़ी से दौड़ना होता है । </p>",
