    'label43':"<p class='app-head-text'>स्कोर सेमी और मिमी (प्रारंभिक स्थिति और अंतिम स्थिति के बीच का अंतर) के रूप में दर्ज किया जाता है, जो हाथ से दूरी तक पहुंचता है।</p>",
    'label44':"<ul class='app-page-list'> <li>जमीन को चिह्नित करने के लिए एक टेप,मार्कर पेन, और रूलर</li> <li>२ फ़ीट लम्बी सीधी आधार रेखा टेप से फ्लोर पर लगाए, माप रेखा जो बेसलाइन के मध्य में  दोनों तरफ २ फ़ीट लम्बी रेखा खींचे</li> <li>माप लाइन के साथ प्रत्येक आधा इंच को इंगित करने के लिए मार्कर पेन का उपयोग करें - वह बिंदु जहां आधार रेखा और माप रेखा प्रतिच्छेद शून्य बिंदु है।</li> </ul>",
    'label45':"<p class='app-head-text'>आमतौर पर लचीलेपन को मापते हैं, और विशेष रूप से पीठ के निचले हिस्से और हैमस्ट्रिंग की मांसपेशियों के लचीलेपन को मापते हैं। यह परीक्षण महत्वपूर्ण है क्योंकि इस शरीर के हिस्से में लंबर लोरडोसिस , आगे की ओर पेल्विक झुकाव और निचली कमर दर्द  का अनुमान रहता है।</p>",
    'label46':"<ulclass='app-page-list'> <li>व्यक्ति अपने जूते निकाल कर फर्श पर अपने पैरों के बीच की रेखा के साथ बैठता है और बेसलाइन के ठीक पीछे रखे गए अपने पैरों के तलवों को 8-12 इंच  की दूरी  रखता है।   </li> <li>अंगूठे आपस में मिले हो  ताकि हाथ एक साथ हों, हथेलियों का सामना करते हुए और मापने की रेखा पर रखे।</li> <li>एक साथी द्वारा सपाट किए गए पैरों के साथ, व्यक्ति धीरे-धीरे  जितना संभव  हो सके आगे तक पहुंचता है, उंगलियों को आधार रेखा और पैरों को सपाट रखता है।</li> <li>तीन प्रयासों के बाद, चौथे प्रयास पर व्यक्ति तीन सेकंड के लिए रोक कर रखता है जबकि वह दूरी दर्ज की जाती है।</li> <li>सुनिश्चित करें कि कोई प्रयास झटकेदार न हों, और यह कि उंगलियां स्तर और पैर सपाट रहें।</li> </ul>",

 
    'label47':"नौकासना (नाव मुद्रा)",
    'label48':'<iframe width="560" height="315" src="https://www.youtube.com/embed/-QRoIVPIvbg" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>',
    'label49':"<p class='app-head-text'>रिकॉर्ड समय (10-60) सेकंड में रखें। 10 सेकंड या न्यूनतम 3 श्वास के लिए मुद्रा धारण करना इष्टतम है। इसे नियमित अभ्यास के साथ 60 सेकंड तक बढ़ाया जा सकता है।</p>",
    'label5':"<p class='app-head-text'>600 मी० दूरी को कम से कम समय में पूरा करने में लिया गया समय।</p>",
    'label50':"<p class='app-head-text'>योगा मैट / गैर - फिसलन सतह। सुनिश्चित करें कि आसन किसी दीवार या कठोर सतह के पास नहीं किया गया है। </p>",
    'label51':"<p class='app-head-text'>संस्कृत में नौका का अर्थ है 'नाव'। यह एक चित्त लेटने का आसन है जिसमें पैर और धड़ उठाना शामिल है। अंतिम स्थिति नाव के आकार से मिलती है, इसलिए इसका नाम नौकासन है । यह पीठ और पेट की मांसपेशियों की ताकत को मापता है।</p>",
    'label52':"<ul class='app-page-list'> <li>फर्श पर बैठें, पैरों को सामने की ओर फैलाएं और उन्हें सीधा रखें और हथेलियों को कूल्हे के किनारे फर्श पर रखें। </li> <li>धड़ को थोड़ा पीछे खींचें और साथ ही पैरों को फर्श से ऊपर उठाएं, घुटनों को सीधा और पैर की उंगलियों को ऊपर की तरफ रखें। भुजाओं को सामने लाएँ और एक दूसरे के सामने हथेलियों के साथ फर्श के समानांतर सीधा फैलाएँ।</li> <li>पैरों को फर्श से लगभग 35- 40 डिग्री के कोण पर रखें और पंजों के अनुरूप सिर को सीधा रखे </li> <li>शरीर का संतुलन कूल्हों पर रहता है और रीढ़ के किसी हिस्से को फर्श को छूने की अनुमति नहीं दी जानी चाहिए।</li> <li>स्तिथि बनाये रखने का समय रिकॉर्ड करें।</li> </ul>",
