    'label92':"<p class='app-head-text'>फ्लैट, साफ सतह, वजन नापने की मशीन, स्टैडोमीटर या मापने वाला टेप जो दीवार पर चिपकाया सके।</p>",
    'label93':"<p class='app-head-text'>बॉडी मास इंडेक्‍स (बीएमआई) किसी प्रतिभागी की वर्तमान लम्‍बाई और वज़न के आधार पर उसकी शरीर की चर्बी (फैट) को मापता है। बीएमआई की गणना, बॉडी मास (एम) और लंबाई(एच ), जिसमे (एम) शरीर का मास किलोग्राम मे और लंबाई (एच) मीटर मे, इस फार्मूले (मास /लंबाई x लंबाई) का उपयोग करते हुए की जाती है। उच्चतम स्कोर शरीर मे चर्बी का उच्च स्कोर दर्शाता है । </p>",
    'label94':"<p class='app-head-text'>लम्‍बाई को सही रूप से मापना </p><ul class='app-page-list'><li>प्रतिभागी के जूते उतार दें और एक समतल सतह पर दीवार के सहारे खड़ा करके लंबाई मापें ।</li> <li>सुनिश्चित करें कि प्रतिभागी सामने सीधे देख रहा हो और नज़र फर्श के समानान्तर हो।</li><li>माप तभी लें,  जब प्रतिभागी का सिर, कंधे, नितंब और एड़ियाँ  दीवार से लगी होनी चाहिए। </li><li>स्‍टेडियोमीटर के फ्लैट हैड-पीस को तब तक नीचे लाएँ जब वह सिर के उपरी भाग को छू न ले।</li> <li>जहां स्‍टेडियोमीटर की जगह मापने वाली टेप का उपयोग करना हो, दीवार के उस स्थान को  चिन्हित करें जहां हैड-पीस का निचला भाग दीवार से मिलता हो । फिर मापने वाली टेप का उपयोग करते हुए जमीन से चिन्हित बिन्दु तक की दूरी को  रिकॉर्ड करें जो प्रतिभागी की लंबाई होगी।</li>    <li>लंबाई को निकटतम सेंटीमीटर तक रिकॉर्ड करें।</li> </ul> <p class='app-head-text'>वज़न को सही रूप से मापना</p> <ul class='app-page-list'><li>डिजिटल स्केल का उपयोग करें। बाथरूम स्‍केल का उपयोग करने से बचें क्‍योंकि उनमें स्प्रिंग लगा होता है। डिजिटल स्‍केल को समतल जमीन पर रखें।</li><li>प्रतिभागी जूते और भारी कपड़े न पहने।</li> <li>प्रतिभागी को डिजिटल स्केल के बीच मे दोनों पैरों पर खड़ा करें।</li><li>वजन को निकटतम किलोग्राम में दर्ज करें।</li></ul>",
   
